import React from 'react'

function Favorited({formData}) {
  return (
    <div>
      <img src={formData.profile} alt="avatar" style={{width: "50px",border :"2px solid grey" , bor}}/>
      <h3>{formData.username}</h3>
      <h3>{formData.location}</h3>
      <h3>{formData.age}</h3>
      {/* <h3>{FormData.timestamp}</h3> */}
    </div>
  );
}

export default Favorited
